import React, {Component} from 'react';
import './App.css';
import Todos from './components/Todos';

class App extends Component{
  state = {
    todos: [
      {
        id: 1,
        title: 'macro magery',
        completed: false
      },
      {
        id: 2,
        title: 'buy regs',
        completed: false
      },
      {
        id: 3,
        title: 'buy armor',
        completed: true
      }
    ]
  }
  render() {
    return (
      <div className="App">
        <Todos todos={this.state.todos} />
      </div>
    );
  }
}

export default App;
